    }


    render() {
        console.log("Carousel", this.props.pic)
        const carouselImg = this.props.pic.map(pic => (
             <div className="carouselHeight">
                    <img src={pic} width="350px" height="150px" />
                        <p className="legend">
                        Legend 
                        </p>
                </div>

        ))
